import React from 'react'

import {Footer, Header, Possibility, Feature } from './containters';
import {CTA, Navbar, Magazine} from './components';

import './app.css';

const app = () => {
  return (
    <div className='App'>
      <div className='gradient_bg'>
        <Navbar/>
        <Header/>
      </div>
      <Feature/>
      <CTA/>
      <Footer/>
    </div>
  )
}

export default app
